css:
atom-text-editor,
:host {
  background-color: #1f2121;
  color: #f9fafc;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #1f2121;
  color: #6e6e72;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #2c2f31;
  color: #f9fafc;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f9fafc;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #2c2f31;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #2c2f31;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #2c2f31;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #2c2f31;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #f9fafc;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #f9fafc;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #2c2f31;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: #2c2f31;
}
.comment {
  color: #6e6e72;
}
.string {
  color: #94f5b4;
}
.constant.numeric {
  color: #2cd364;
}
.constant.language {
  color: #7f66e5;
}
.constant.character,
.constant.other {
  color: #7f66e5;
}
.variable {
  color: #b1b3f8;
}
.keyword {
  color: #fbd900;
}
.storage {
  color: #89e8e8;
}
.storage.type {
  font-style: italic;
  color: #09cac4;
}
.entity.name.class {
  text-decoration: underline;
  color: #f3e487;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #f3e487;
}
.entity.name.function {
  color: #ef2550;
}
.variable.parameter {
  font-style: italic;
  color: #b1b3f8;
}
.entity.name.tag {
  color: #fbd900;
}
.entity.other.attribute-name {
  color: #09cac4;
}
.support.function {
  color: #89e8e8;
}
.support.constant {
  color: #7f66e5;
}
.support.type,
.support.class {
  color: #f3e487;
}
.support.other.variable {
  color: #b1b3f8;
}
.source.ruby {
  color: #c5c8c6;
}
.constant.other.symbol.ruby.19syntax {
  color: #99cc99;
}
.variable.other.constant.ruby {
  color: #c6c5e2;
}
.entity.name.type.class.ruby {
  color: #f3e487;
}
.entity.name.type.module.ruby {
  color: #f3e487;
}
.source.ruby.embedded.source {
  color: #ededed;
}
.source.ruby.embedded.source .punctuation.section.embedded.ruby {
  color: #09cac4;
}
.storage.modifier.import.java {
  color: #89e8e8;
}
.storage.modifier.java {
  color: #ed708f;
}
.entity.name.type.class.java {
  text-decoration: underline;
  color: #f3e487;
}
.storage.type.primitive.array.java {
  color: #89e8e8;
}
.storage.type.object.array.java {
  color: #89e8e8;
}
.constant.numeric.java {
  color: #2cd364;
}
.storage.type.java {
  color: #09cac4;
}
.keyword.operator.dereference.java {
  color: #2cd364;
}
.markup.inserted.diff,
.meta.diff.header.to-file {
  color: #2cd364;
}
.markup.deleted.diff,
.meta.diff.header.from-file {
  color: #ef2550;
}
